import { StyleSheet, Text, SafeAreaView } from 'react-native'
import tw from 'tailwind-react-native-classnames'
import React,{useState} from 'react'

const ChatbotScreen = () => {
  const [chats,setChats] = useState([
    {
      name: 'bot',
      text:"babababa"
    },
    {
      name:'user',
      text:"bababa"
    }
  ])
        {/*(chat.name === 'bot' && <Text style={tw`bg-blue-400`}>{`${chat.name} : ${chat.text}`}</Text>
        )*/}
  return (
    <SafeAreaView style={tw`top-8`}>
      {/*<Text>ChatbotScreen</Text>*/}
      {chats.map((chat) =>{
        return(
          <View style={tw`flex`}>
            {chat.name === 'bot' && 
            <Text style={tw`bg-blue-400 p-2 rounded-lg`}>
            {`${chat.name} : ${chat.text}`}
            </Text>}
            {chat.name === 'user' && 
            <Text style={tw`bg-yellow-400 p-2 rounded-lg`}>
            {`${chat.name} : ${chat.text}`}
            </Text>}
          </View>
        )
      }

      )}
      {console.log(chats[0].name)}
      <Text>Hello</Text>
    </SafeAreaView>
  )
}



export default ChatbotScreen

const styles = StyleSheet.create({
  chatbot: {
    backgroundColor: 'blue'
  },
  userbot: {

  }
})
